}

RegExp reg = RegExp(r'(\d{1,3})(?=(\d{3})+(?!\d))');
String Function(Match) mathFunc = (Match match) => '${match[1]},';

String cutNum(num? str) {
  return str == null
      ? '0'
      : str >= 1000000
          ? '${(str / 1000000).toStringAsFixed(2)}M'
          : str >= 1000
              ? '${(str / 1000).toStringAsFixed(0)}K'
              : str.toStringAsFixed(0);
}

String getStage(MarketingCustomerModel data) {
  return data.unknown == 1
      ? 'Chưa xác định'
      : data.inactive == 1
          ? 'Báo giá'
          : data.pending == 1
              ? "Tạm dừng"
              : data.active == 1
                  ? "Đang chạy"
                  : "Hoàn Thành";
}

String getDatetimeFormat(String date) {
  return DateFormat('dd/MM').format(DateTime.parse(date));
}

final List<String> categories = ["Kế hoạch", "Thực chạy"];
String cutNumKpi(num? str) {
  return str == null
      ? ' KPIs 0'
      : str >= 1000000
          ? ' KPIs ${(str / 1000000).toStringAsFixed(2)}M'
          : str >= 1000
              ? ' KPIs ${(str / 1000).toStringAsFixed(0)}K'
              : ' KPIs ${str.toStringAsFixed(0)}';
}

String countPercent(num? a, num? b) {
  return b == null
      ? '0%'
      : '${(((a ?? 0) / b) * 100).toStringAsFixed(0).replaceFirst('NaN', '0').replaceFirst('Infinity', '0')}%';
}

String addComma(String str) {
  return str.replaceAllMapped(reg, mathFunc).replaceFirst('.0', '');
}

Color returnColorPercent(avg) {
  return avg >= 0.99
      ? const Color(0xFF3949AB)
      : (avg < 1 && avg >= 0.75)
          ? const Color(0xFF00CCB1)
          : (avg >= 0.5 && avg < 0.75)
              ? const Color(0xFFFCA326)
              : const Color(0xFFE24329);
}

Color returnColorKpi(name) {
  return name == 'Facebook'
      ? const Color(0x66334FF8)
      : name == 'Admicro' || name == 'Google'
          ? const Color(0x66FC6D26)
          : name == 'Vnexpress'
              ? const Color(0xFF9F224E)
              : name == 'Zalo'
                  ? const Color(0x6626C5FE)
                  : const Color(0xFF828282);
}

